	{
		var difpct = to-from;
		var currPCT = basePct-from;
		currPCT  = (currPCT <0) ? 0 : currPCT;
		currPCT  = (currPCT > difpct) ? difpct : currPCT;
		currPCT = currPCT/difpct;
		return currPCT;
	}

